window.bookSummaryJSON = "<p>Perry Stone hasn't gotten over his fear of being outside and he still hasn't settled into life in the Empire's Navy. After months of legal wrangling over his last assignment, he has been given a new assignment. He was looking forward to getting a new posting on a spaceship or a station. The problem is that his new job is on a planet. Worse, once there, the base is overrun by the enemy aliens and now Stone is trapped outside on a hostile planet, injured, and hunted by aliens bent of killing him. </p>"; 
